import logo from './logo.svg';
import './App.css';
import "@awsui/global-styles/index.css"
import React from 'react';
import ReactDOM from 'react-dom';

// import AppLayout from "@awsui/components-react/app-layout"
// import Container from "@awsui/components-react/"
// import Button from "@awsui/components-react/button"
import { SpaceBetween, Button, AppLayout, Container, FormField, Form, Input, Select, Header } from '@awsui/components-react';

function App() {
  return (
<AppLayout

      content={
        <Form
          actions={
            <SpaceBetween direction="horizontal" size="xs">
              <Button variant="link">Cancel</Button>
              <Button variant="primary">Next</Button>
            </SpaceBetween>
          }
          header={
            <Header variant="h1" description="Non Profit Organization Signup">
              Non Profit Organization Signup
            </Header>
          }
        >
          <Container header={<Header variant="h2">Form container header</Header>}>
            <SpaceBetween direction="vertical" size="l">
              <FormField label="Organization Name" description="Name of the organization">
                <Input></Input>
              </FormField>
              <FormField label="Select field">
                <Select
                  options={[
                    {
                      label: "Option 1",
                      value: "option-1"
                    },
                    {
                      label: "Option 2",
                      value: "option-3"
                    },
                    {
                      label: "Option 3",
                      value: "option-3"
                    }
                  ]}
                  selectedAriaLabel="selected"
                />
              </FormField>
            </SpaceBetween>
          </Container>
        </Form>
      }
    />  );
}

export default App;
